/*Table structure for table `goods` */

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `origin` varchar(255) DEFAULT NULL,
  `provider` varchar(255) DEFAULT NULL,
  `unit` varchar(255) DEFAULT NULL,
  `barCode` varchar(255) DEFAULT NULL,
  `qrCode` varchar(255) DEFAULT NULL,
  `operator` varchar(255) DEFAULT NULL,
  `importTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `promotionReason` varchar(255) DEFAULT NULL COMMENT '为空则不促销',
  `status` int(11) DEFAULT '0' COMMENT '绑定状态',
  `price` decimal(12,2) DEFAULT NULL,
  `promotePrice` decimal(12,2) DEFAULT NULL,
  `photo` longblob,
  `waitUpdate` int(11) DEFAULT '0' COMMENT '是否等待更新',
  `shelfNumber` varchar(255) DEFAULT NULL,
  `spec` varchar(255) DEFAULT NULL,
  `category` varchar(255) DEFAULT NULL,
  `rfu01` varchar(10) DEFAULT NULL,
  `rfu02` varchar(10) DEFAULT NULL,
  `rfus01` varchar(255) DEFAULT NULL,
  `rfus02` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `barCode` (`barCode`)
) ENGINE=InnoDB AUTO_INCREMENT=784 DEFAULT CHARSET=utf8;

