/*Table structure for table `post` */

DROP TABLE IF EXISTS `post`;

CREATE TABLE `post` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `subject` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '帖子标题',
  `type` varchar(25) COLLATE utf8_bin NOT NULL COMMENT '帖子类型',
  `content` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '帖子内容',
  `send_open_id` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '发布者openID',
  `phone_number` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '发布者联系方式',
  `love_num` int(255) DEFAULT '0' COMMENT '点赞数',
  `look_num` int(255) DEFAULT '0' COMMENT '浏览数',
  `publish_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '发布时间',
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `post` */

/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` varchar(50) COLLATE utf8_bin DEFAULT '0' COMMENT '商品编号',
  `NAME` varchar(50) COLLATE utf8_bin DEFAULT '0' COMMENT '商品名字',
  `place` varchar(20) COLLATE utf8_bin DEFAULT '0' COMMENT '商品产地',
  `seller` varchar(20) COLLATE utf8_bin DEFAULT '0' COMMENT '供应商',
  `price` double DEFAULT '0' COMMENT '价格',
  `unit` varchar(10) COLLATE utf8_bin DEFAULT '0' COMMENT '单位',
  `promotionprice` float DEFAULT '0' COMMENT '促销价格',
  `if_promotion` tinyint(1) DEFAULT '0' COMMENT '是否促销，1为促销',
  `reason` varchar(10) COLLATE utf8_bin DEFAULT '0' COMMENT '促销原因',
  `barcode` int(50) DEFAULT '0' COMMENT '商品条码',
  `qrcode` varchar(10) COLLATE utf8_bin DEFAULT '0' COMMENT '二维码',
  `if_bind` tinyint(1) DEFAULT '0' COMMENT '是否绑定，1为绑定',
  `operator` varchar(40) COLLATE utf8_bin DEFAULT '0' COMMENT '操作员',
  `updatetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=217 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

