/*Table structure for table `shops` */

DROP TABLE IF EXISTS `shops`;

CREATE TABLE `shops` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '店铺类型：1表示总店，2表示分店',
  `number` varchar(20) NOT NULL COMMENT '店铺号',
  `fatherShop` varchar(20) DEFAULT NULL COMMENT '父店铺号',
  `name` varchar(50) NOT NULL COMMENT '店铺名称',
  `manager` varchar(10) NOT NULL COMMENT '店铺管理员',
  `address` varchar(50) DEFAULT NULL COMMENT '店铺地址',
  `account` varchar(20) DEFAULT NULL,
  `password` varchar(20) DEFAULT NULL,
  `phone` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

