  `power` varchar(100) DEFAULT NULL,
  `tagRssi` varchar(100) DEFAULT NULL,
  `state` tinyint(10) DEFAULT '0' COMMENT '是否绑定',
  `goodid` bigint(20) DEFAULT NULL,
