  `barCode` varchar(150) DEFAULT NULL,
  `tagAddress` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `barCode` (`barCode`),
  KEY `FK_5nrqxco6cbi7gw4sa50c9d852` (`styleid`),
  KEY `FK_81of0a589w8y5ekc9saf99sxc` (`routerid`),
  KEY `UK_o4m95mr5vtshjftctk4khjddt` (`goodid`),
