  CONSTRAINT `tags_ibfk_2` FOREIGN KEY (`routerid`) REFERENCES `routers` (`id`),
  CONSTRAINT `tags_ibfk_3` FOREIGN KEY (`goodid`) REFERENCES `goods` (`id`)
